    const location = useLocation();
    console.log(location)
    return (
        <div className="fullscreen">
            <div className="back">
                <ArrowBackOutlined />
                Home
            </div>
            <video className="video" autoPlay progress="true" controls src="/assets/trailer.mp4"></video>
        </div>
    )
}

export default FullScreen
